portalLogoName:"Logo e Nome",changeThumb:"Clique para alterar a miniatura",orgName:"Nome da Organiza\u00e7\u00e3o",portalName:"Nome",verifySetting:"Verifica\u00e7\u00e3o da Organiza\u00e7\u00e3o",verifyDesc:"Por forma a marcar os itens que partilhou com todos como Fidedignos, necessita de solicitar que a Esri verifique a identidade da sua organiza\u00e7\u00e3o. Para fazer isto, assegure-se de que a sua organiza\u00e7\u00e3o permite acesso an\u00f3nimo (Defini\u00e7\u00f5es \x3e Seguran\u00e7a \x3e Pol\u00edticas), depois clique no bot\u00e3o Verificar abaixo. Surgir\u00e1 uma mensagem de correio eletr\u00f3nico em rascunho. Envie-a para o Servi\u00e7o de Apoio ao Cliente da Esri. Por favor, n\u00e3o altere o texto ou os destinat\u00e1rios desta mensagem de correio eletr\u00f3nico. Ap\u00f3s rececionada, o Servi\u00e7o de Apoio ao Cliente ir\u00e1 verificar que a sua organiza\u00e7\u00e3o corresponde ao seu nome de cliente dentro de 24 - 48 horas \u00fateis e o bot\u00e3o Verificar ser\u00e1 substitu\u00eddo por um s\u00edmbolo Verificado.\x3cbr\x3e\x3cbr\x3e\x3cstrong\x3eNota:\x3c/strong\x3e Ap\u00f3s a sua organiza\u00e7\u00e3o ter sido verificada, o respetivo nome de organiza\u00e7\u00e3o e estado n\u00e3o podem ser alterados e todos os itens fidedignos partilhados com todos ser\u00e3o atribu\u00eddos ao nome da organiza\u00e7\u00e3o.",
