browserDefaultAGOL:"Se selecionar Navegador Padr\u00e3o (e permitir acesso an\u00f3nimo), os utilizadores an\u00f3nimos ver\u00e3o o ArcGIS Online no idioma do seu navegador. Para utilizadores com sess\u00e3o iniciada que tenham configurado o seu idioma no seu perfil, o portal ser\u00e1 exibido nesse idioma.",browserDefaultPortal:"Se selecionar Navegador Padr\u00e3o (e permitir acesso an\u00f3nimo), os utilizadores an\u00f3nimos ver\u00e3o o portal no idioma do seu navegador. Para utilizadores com sess\u00e3o iniciada que tenham configurado o seu idioma no seu perfil, o portal ser\u00e1 exibido nesse idioma.",
numDateFormat:"N\u00famero e formato de data",learnNumDateFormat:"Saiba mais sobre como definir o n\u00famero e formato de data para a organiza\u00e7\u00e3o.",regionSetting:"Regi\u00e3o",regionDesc:"Selecione uma regi\u00e3o para determinar a galeria de mapas base predefinida, o mapa base predefinido e a extens\u00e3o predefinida para novos mapas da sua organiza\u00e7\u00e3o. A regi\u00e3o selecionada controla tamb\u00e9m a barra de escala, a ferramenta de medi\u00e7\u00e3o e as unidades de rotas. Se selecionar Estados Unidos, as unidades s\u00e3o definidas para milhas e p\u00e9s; qualquer outra regi\u00e3o, incluindo Mundo, define as unidades para metros e quil\u00f3metros.",
